import React from "react";
//Styles
import "./Icons.css";
type props = {
	title: string;
};

const Icons: React.FC<props> = ({ title }) => {
	const icon_container = React.useRef<HTMLDivElement>(null);

	const onClick = (e: MouseEvent) => {
		console.log(icon_container.current);
		if (icon_container.current) console.log(icon_container.current.style);
	};
	const onFocus = (e: FocusEvent) => {
		e.preventDefault();
		if (icon_container.current) console.log(icon_container.current.style);
	};
	return (
		<div className='icon-container' ref={icon_container}>
			<span>{title}</span>
		</div>
	);
};

export default Icons;
